// src/data.js
const images = [
  {
    src: "images/img1.jpg", // Path to the image file
    alt: "Image 1", // Descriptive text for accessibility
    title: "Title of Image 1", // Displayed title
    description: "Description of Image 1", // Optional description
  },
  // ... add other image objects for each image in your gallery
];

export default images;
